script: |
  super -f text -I q8378.spq | sort > q8378.out

inputs:
  - name: q8378.spq
    data: |
      SELECT - col1 AS col2 FROM tab0 (FORMAT parquet) WHERE 99 * col1 NOT BETWEEN ( ( + 58 ) + - col2 ) AND + col0 * col1 + + col0;
  - name: tab0

outputs:
  - name: q8378.out
    data: |
      -21
      -81
